function Info() {
  return (
    <div className='info'>
      
      <div className='farm-img'>
        <img src={farm9} height="400px" width="1200px"/>
      </div>

     <div className='cards'>

         <div className='card1'>
            <img src={reg1} height="150px" width="145px"/><br></br>
           <label>Registration</label> 
           
         </div>

     </div>

    </div>
  )
}

export default Info
